import bisect
class Solution(object):
    def maxEnvelopes(self, envelopes):
        """
        :type envelopes: List[List[int]]
        :rtype: int
        """
        if not envelopes:
            return 0
        envelopes.sort(key=lambda x:(x[0],-x[1]))
        h=[]
        for i,e in enumerate(envelopes,0):
            j=bisect.bisect_left(h,e[1])
            if j<len(h):
                h[j]=e[1]
            else:
                h.append(e[1])
        return len(h)

